import React, {Component} from 'react';

class Header extends Component {
    constructor(props){
        super(props);
        this.state = {
            website: "Node Twitter"
        }

    }

    render(){

        return(
            <div className="header">
                <h1></h1>
            </div>
        );
    }
}

export default Header;
